import React, { useEffect, useState } from 'react';

const CredentialList = () => {
  const [credentials, setCredentials] = useState([]);

  useEffect(() => {
    // Fetch credentials from the backend (mocking for now)
    const fetchedCredentials = [
      { title: 'React Basics', category: 'Web Development', eqfLevel: 3 },
      { title: 'JavaScript Mastery', category: 'Programming', eqfLevel: 4 },
    ];
    setCredentials(fetchedCredentials);
  }, []);

  return (
    <div>
      <h2>Available Microcredentials</h2>
      <ul>
        {credentials.map((cred, index) => (
          <li key={index}>
            <h3>{cred.title}</h3>
            <p>{cred.category}</p>
            <p>EQF Level: {cred.eqfLevel}</p>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default CredentialList;
